import React from "react";
import Comment from "./Comment";

const comments = [
    {
        id: 1,
        comment: "안냐세요",
    },
    {   
        id: 2,
        comment: "안녕~"
    },
    {
        id: 3,
        comment: "안녕하십니까?",
    },
];

function CommentList(props){
    return (
        <div>
            {comments.map((comment) => {
                return (
                    <Comment name={comment.name} comment={comment.comment} />
                );
            })}
        </div>
    );
}

export default CommentList;
